function zwei = zeta_wei(ord,sten,ps,qs,cs,r2mQh2,h,pre_E,F,G)
% Compute geometric zeta correction weights for the kernel
%       K(r) = c1*r^p1+c2*r^p2+...
% with or without precomputed singular zeta weights.
% (Note: geometric weights = geometric factors * singular weights)
%
% Inputs:
%   ord = desired order of convergence
%   P = struct containing info of a geometric patch
%   ps = [p1,p2,...], powers in the kernel K(r)
%   cs = [c1,c2,...], smooth geometric factors in the kernel K(r)
%   qs = [q1,q2,...], smoothness offset, assume geometric factors cs(i) are O(h^{2*qs(i)})
%   pre (optional) : contains precomputed epstein zeta vals, pre.zeta{i,j} = D^(j+1)Z(pre.s(i))
% Outputs:
%   zwei = geometric zeta weights ( = geometric factor * singular zeta weight )

if nargin == 8 && ~isempty(pre_E)
    precom = 1; pre=pre_E; 
elseif nargin == 10
    precom = 0; E = pre_E;
else
    error('need first fundamental form E,F,G to compute zeta weights!')
end

zwei = zeros(size(r2mQh2));     % init geometric zeta wei
for k = 1:numel(ps)
    p = ps(k); c = cs{k}; q = qs(k);
    M = ceil((ord-p)/2)-2-q;
    if M < 0, continue; end
    for m = 0:2*M 	% correct 2M+1 terms in the kernel expansion
        l1=ceil(3*m/2)+q;	% stencil inner layer = l1
        l2=M+m+q;        	% stencil outer layer = l2+1
        Qpow = m-p/2;   	% power of the quadratic form in the m-th term
        % compute extrinsic smooth factors
        exfac = binom(p/2,m)*h^(2+p)*c.*r2mQh2.^m;
        % compute intrinsic zeta weights
        if precom   % use precomputed zeta vals
            tau = zeta_intr_wei(l1,l2,Qpow,pre);     
        else        % compute on the fly
            tau = zeta_intr_wei(l1,l2,Qpow,E,F,G);
        end
        % cumulate extrinsic zeta weights for the m-th expansion term
        zwei=zeta_extr_wei_update(zwei,sten,l1,l2,exfac,tau);
    end
end
% if q > 0 % delete unused stencil points
%     iz = 1:2*q*(q-1)+1; % indices of unused local stencils
%     zwei(iz,:) = [];
%     for i = 1:3, dloc{i}(iz,:) = []; end
%     indsten(iz,:) = [];
%     sten.i(iz) = []; sten.j(iz) = [];
% end
%subplot(1,2,1), imagesc(log10(abs(zexwei)))
%subplot(1,2,2), imagesc(P.supp(indsten))
end

function zexwei = zeta_extr_wei_update(zexwei,sten,l1,l2,exfac,tau)
% Update extrinsic zeta correction weights
% Input:
%   zexwei = extrinsic zeta weights
%   sten = struct constaining stencil info
%   l1, l2: updating weights on layers l1 <= l <= l2 + 1
%   exfac = extrinsic smooth factors
%   tau = intrinsic zeta weights on layers l1 <= l <= l2 + 1

%nt = size(tau,1);        	% correction weights DoF
l0 = sten.l0;
% 1. inner layer (symmetric about axes)
taus=tau(1:l1+1,:);
if l1>1, taus=[taus;tau(l1:-1:2,:)]; end    % off-axis copies
if l1>0, taus = kron([1;1],taus); end       % central symmetry copies
inds = sten.ind(l1-l0+1):sten.ind(l1-l0+2)-1;     % stencil inds for layer-l1
zexwei(inds,:) = zexwei(inds,:)+taus.*exfac(inds,:); 
% 2. intermediate layers (symmetric about center)
if l2 > l1
    inds=sten.ind(l1-l0+2):sten.ind(l2-l0+2)-1;	% stencil inds for layers (l1+1) to l2
    % assemble intrinsic weights based on symmetry
    lt = l1+1; taus = [];
    for l = l1+1:l2
        taus = [taus; kron([1;1],tau(lt+1:lt+2*l,:))]; % tau central symm on the l-th layer
        lt = lt+2*l;
    end
    %taus = kron([1;1],tau(l1+2:nt-l2,:));  	% tau central symm copies
    zexwei(inds,:) = zexwei(inds,:)+taus.*exfac(inds,:);
end
% 3. outer layer (anti-symmetric about axes)
if l2 > 0
    % stencil inds for layer l2+1
    inds=sten.ind(l2-l0+2):sten.ind(l2-l0+3)-1;
    % exclude axes pts (only for inside layers, outermost layer already excluded)
    if l2-l0+3<numel(sten.ind), inds(1:l2+1:end)=[]; end
    taus=tau(end-l2+1:end,:);               % tau
    taus=kron([1;1],[taus;-flipud(taus)]);	% anti-symm & central symm copies
    zexwei(inds,:) = zexwei(inds,:)+taus.*exfac(inds,:);
end
end

function tau = zeta_intr_wei(l1,l2,Qpow,E_pre,F,G)
% Compute intrinsic zeta correction weights (only depends on coeffs of
% first fundamental form, independent of extrinsic geometry or
% discretization)
%
% tau = zeta_intr_wei(l1,l2,Qpow,pre) compute intrinsic weights using
%       precomputed zeta values: pre.zeta{i,j} = D^(j+1)Z(pre.s(i))
% tau = zeta_intr_wei(l1,l2,Qpow,E,F,G) compute intrinsic weights on the
%       fly using first fundamental form coeffs (E,F,G)

C = stencil_inv(l1,l2); % use precomputed C = inv(A)
if isempty(C)
    % form monomial powers (a,b) for each row u^a * v^b
    % such that a+b=2*l, for all l1<=l<=l2
    a = []; b = [];
    for p=2*(l1:l2), a=[a;(p:-1:0)']; b=[b;(0:p)']; end
    % Construct fitting matrix A on the (u,v) reduced stencil
    n = numel(a); A = zeros(n);
    % 1. inner layer (symmetric about axes)
    u=l1:-1:0; v=0:l1;
    A(:,1:l1+1)=u.^a.*v.^b;
    if l1>0, A(:,1:l1+1)=2*A(:,1:l1+1); end % on-axis pts
    if l1>1, A(:,2:l1)=A(:,2:l1)+2*(-u(2:l1)).^a.*v(2:l1).^b; end % off-axis pts
    % 2. intermediate layers (symmetric about center)
    if l2 > l1
        u=[]; v=[]; % assemble stencil layers l, l1<l<=l2
        for l=l1+1:l2, u=[u,l:-1:-l+1]; v=[v,0:l-1,l:-1:1]; end
        A(:,l1+2:n-l2)=2*u.^a.*v.^b;
    end
    % 3. outer layer (anti-symmetric about axes)
    if l2>0, u=l2:-1:1; v=1:l2; A(:,n-l2+1:n)=2*(u.^a.*v.^b-(-u).^a.*v.^b); end
end
% Compute Wigner limits
W = [];
if nargin == 4      % use precomputed zeta vals
    pre = E_pre;
    for l = l1:l2
        s = Qpow-l;
        fallpow = 1/prod(-s-l+1:-s); % Knuth falling factorial
        if 1 % switch off to collect the pairs [2*s,l] for zeta precomputation
            Z = pre.zeta{2*s == pre.s,l+1};
            W = [W;-fallpow*Z];
        else
            disp([2*s,l]) % collect input combinations to accelerate epstein zeta
            W = zeros(size(C,2),1);
        end
    end
elseif nargin == 6  % compute zeta vals on the fly
    E = E_pre;
    for l = l1:l2
        s = Qpow-l;
        fallpow = 1/prod(-s-l+1:-s); % Knuth falling factorial
        if 1 % switch off to collect the pairs [2*s,l] for zeta precomputation
            Z = epstein_zeta_deriv(2*s,l,E,F,G); % l-th derivatives of zeta fun
            W = [W;-fallpow*Z];
        else
            disp([2*s,l]) % collect input combinations to accelerate epstein zeta
            W = zeros(size(C,2),1);
        end
    end
else
    error('not enough info to compute zeta values')
end
if ~isempty(C)
    tau = C*W; % precomputed inv(A)
else
    tau = double(inv(sym(A)))*W; % solve for zeta weights (symbolic combat ill-cond)
end
end

function c = binom(n,k)
% generalized binomial coeff, n = any real number, k = positive integer
c = prod(n-k+1:n)/gamma(k+1); 
end

