function sq = epstein_zeta_deriv(s,d,E,F,G)
% Compute all possible d-th parametric partial derivative of 
% the Epstein zeta function, \partial^d Z(s;E,F,G)
if d == 0
    %sq = epstein_zeta_int(s,E,F,G);
    sq = epstein_zeta(s,E,F,G);
elseif d == 1
    [~, d1_E] = epstein_zeta_int(s,E,F,G,1,0,0);    % TODO: combine these
    [~, d1_G] = epstein_zeta_int(s,E,F,G,0,0,1);
    [~, d1_F] = epstein_zeta_int(s,E,F,G,0,0.5,0);
    sq = [d1_E; d1_F; d1_G];
elseif d == 2
    [~, ~, d2_E] = epstein_zeta_int(s,E,F,G,1,0,0); % TODO: combine these
    [~, ~, d2_G] = epstein_zeta_int(s,E,F,G,0,0,1);
    [~, ~, d2_F] = epstein_zeta_int(s,E,F,G,0,0.5,0);
    [~,~,d2_EpF] = epstein_zeta_int(s,E,F,G,1,.5,0);
    [~,~,d2_GpF] = epstein_zeta_int(s,E,F,G,0,.5,1);
    sq = [d2_E; (d2_EpF-d2_E-d2_F)/2; d2_F; (d2_GpF-d2_F-d2_G)/2; d2_G];
elseif d == 3
    [~,~,~, d3_E] = epstein_zeta_int(s,E,F,G,1,0,0);
    [~,~,~, d3_G] = epstein_zeta_int(s,E,F,G,0,0,1);
    [~,~,~, d3_F] = epstein_zeta_int(s,E,F,G,0,0.5,0);
    [~,~,~,d3_EpF] = epstein_zeta_int(s,E,F,G,1,.5,0);
    [~,~,~,d3_EmF] = epstein_zeta_int(s,E,F,G,1,-.5,0);
    [~,~,~,d3_GpF] = epstein_zeta_int(s,E,F,G,0,.5,1);
    [~,~,~,d3_GmF] = epstein_zeta_int(s,E,F,G,0,-.5,1);
    sq = [d3_E; (d3_EpF-d3_EmF-2*d3_F)/6; (d3_EpF+d3_EmF-2*d3_E)/6;...
          d3_F; (d3_GpF+d3_GmF-2*d3_G)/6; (d3_GpF-d3_GmF-2*d3_F)/6; d3_G];
elseif d == 4
    [~,~,~,~,   d4_E] = epstein_zeta_int(s,E,F,G,1,0,0);
    [~,~,~,~,   d4_G] = epstein_zeta_int(s,E,F,G,0,0,1);
    [~,~,~,~,   d4_F] = epstein_zeta_int(s,E,F,G,0,0.5,0);
    [~,~,~,~, d4_EpF] = epstein_zeta_int(s,E,F,G,1,.5,0);
    [~,~,~,~,d4_Ep2F] = epstein_zeta_int(s,E,F,G,1,1,0);
    [~,~,~,~, d4_EmF] = epstein_zeta_int(s,E,F,G,1,-.5,0);
    [~,~,~,~, d4_GpF] = epstein_zeta_int(s,E,F,G,0,.5,1);
    [~,~,~,~,d4_Gp2F] = epstein_zeta_int(s,E,F,G,0,1,1);
    [~,~,~,~, d4_GmF] = epstein_zeta_int(s,E,F,G,0,-.5,1);
    sq = [d4_E;...
        (6*d4_EpF-2*d4_EmF-d4_Ep2F-3*d4_E+12*d4_F)/24;...
        (d4_EpF+d4_EmF-2*d4_E-2*d4_F)/12;...
        (d4_Ep2F-3*d4_EpF-d4_EmF+3*d4_E-12*d4_F)/24;...
        d4_F;...
        (d4_Gp2F-3*d4_GpF-d4_GmF+3*d4_G-12*d4_F)/24;...
        (d4_GpF+d4_GmF-2*d4_G-2*d4_F)/12;...
        (6*d4_GpF-2*d4_GmF-d4_Gp2F-3*d4_G+12*d4_F)/24;
        d4_G];
else
    error('%d-th derivatives not yet implemented!',d)
end
end